INSERT INTO `v1_3b7ce9525572053fcfa089fe64949b2c0d790d5bf768132711ee02cc9fd832a7` VALUES (0, 5, 111011, 11, "さてな。\n存知のように、ぼくも今は都暮らしだ。\n里の連中とはしばらく会っとらんが、\nまあ、向こう百年はくたばらんだろう。", 1007404050, 1007404, 0.5, 1, 0, 0);
